import React from "react";
import { getMessages, sendMessage } from "../../Services/phyapi.js";

// should make this load from a file and create sub-components for simplicity
class MessageBoard extends React.Component {
    handleMessage() {

        alert("Message Sent!")
    }
    async requestMessages() {
        let messages = await getMessages();
        console.log(messages);
        alert("Fetched messages")
    }
    render() {
        return (
            <div class="standard">
                <h1>Message Board</h1>
                <p>
                    This page is in development
                </p>
                <button onClick={this.requestMessages}>
                    Send
                </button>
                <button onClick={this.handleMessage}>
                    Send
                </button>
            </div>
        )
    }
}

export default MessageBoard;
